import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";
import { Link } from "react-router-dom";

function NewTicketForm() {
  return (
    <>
      <IndexNavbar />

      <div style={pageContainer}>
        <div style={card}>
          {/* Form Section */}
          <div style={formSection}>
            <h2 style={title}>🎫 Créer un nouveau ticket</h2>

            <form style={formStyle}>
              <div style={inputGroup}>
                <label style={label}>Sujet</label>
                <input
                  type="text"
                  placeholder="Ex : Virement non effectué"
                  style={input}
                />
              </div>

              <div style={inputGroup}>
                <label style={label}>Département</label>
                <select style={input}>
                  <option>IT - Informatique</option>
                  <option>RH - Ressources Humaines</option>
                  <option>Comptabilité</option>
                </select>
              </div>

              <div style={inputGroup}>
                <label style={label}>Type de ticket</label>
                <select style={input}>
                  <option>Urgent</option>
                  <option>Normal</option>
                  <option>Faible priorité</option>
                </select>
              </div>

              <div style={inputGroup}>
                <label style={label}>Description</label>
                <textarea
                  rows="4"
                  placeholder="Décrivez le problème..."
                  style={textarea}
                ></textarea>
              </div>

              <div style={footerButtons}>
                <Link to="MyTickets" style={linkStyle}>← Retour</Link>
                <button type="submit" style={submitBtn}>Créer le ticket</button>
              </div>
            </form>
          </div>

          {/* Image / Illustration */}
          <div style={imageSection}>
            <img
              src="https://images.unsplash.com/photo-1605902711622-cfb43c4437b2?ixlib=rb-4.0.3&auto=format&fit=crop&w=900&q=80"
              alt="Banque illustration"
              style={imageStyle}
            />
          </div>
        </div>
      </div>

      <Footerr />
    </>
  );
}

// 🌈 Styles
const pageContainer = {
  backgroundColor: "#f0f4f8",
  minHeight: "100vh",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  padding: "2rem",
};

const card = {
  display: "flex",
  flexDirection: "row",
  backgroundColor: "#ffffff",
  borderRadius: "16px",
  boxShadow: "0 8px 24px rgba(0, 0, 0, 0.1)",
  maxWidth: "1000px",
  width: "100%",
  overflow: "hidden",
};

const formSection = {
  flex: 1,
  padding: "3rem",
  backgroundColor: "#ffffff",
};

const imageSection = {
  flex: 1,
  backgroundColor: "#e3ecf4",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
};

const imageStyle = {
  width: "100%",
  height: "100%",
  objectFit: "cover",
  filter: "brightness(0.9)",
};

const title = {
  fontSize: "1.8rem",
  fontWeight: "700",
  color: "#0d47a1",
  marginBottom: "1.5rem",
};

const formStyle = {
  display: "flex",
  flexDirection: "column",
  gap: "1.2rem",
};

const inputGroup = {
  display: "flex",
  flexDirection: "column",
};

const label = {
  fontWeight: "500",
  marginBottom: "0.4rem",
  color: "#333",
};

const input = {
  padding: "0.9rem",
  fontSize: "1rem",
  borderRadius: "8px",
  border: "1px solid #ccc",
  backgroundColor: "#f9f9f9",
};

const textarea = {
  ...input,
  resize: "vertical",
  minHeight: "100px",
};

const footerButtons = {
  marginTop: "1.5rem",
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
};

const submitBtn = {
  backgroundColor: "#0d47a1",
  color: "#fff",
  border: "none",
  padding: "0.9rem 1.6rem",
  fontSize: "1rem",
  borderRadius: "8px",
  cursor: "pointer",
  fontWeight: "600",
};

const linkStyle = {
  color: "#0d47a1",
  textDecoration: "none",
  fontWeight: "500",
};

export default NewTicketForm;
